import React from 'react';
import {
    Box,
    Typography,
    Card,
    CardContent,
    useTheme,
    Avatar,
    Link,
    Stack,
    Tooltip,
    Paper
} from '@mui/material';
import {
    Email as EmailIcon,
    Phone as PhoneIcon,
    LinkedIn as LinkedInIcon,
    LocationOn as LocationIcon,
    Business as BusinessIcon,
} from '@mui/icons-material';
import Tree, { RawNodeDatum, CustomNodeElementProps } from 'react-d3-tree';
import { User } from '../types/User';

interface TreeData extends RawNodeDatum {
    name: string;
    attributes?: {
        id?: string;
    };
    children?: TreeData[];
}

const UserProfileCard: React.FC<{ user?: User }> = ({ user }) => {
    const theme = useTheme();

    if (!user) return null;

    return (
        <Card sx={{ 
            width: 280,
            m: 1,
            transition: 'all 0.2s ease-in-out',
            '&:hover': {
                transform: 'translateY(-4px)',
                boxShadow: theme.shadows[8]
            }
        }}>
            <CardContent>
                <Stack spacing={2}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                        <Avatar
                            src={user.imageUrl || `https://ui-avatars.com/api/?name=${encodeURIComponent(user.name)}&background=random`}
                            alt={user.name}
                            sx={{ width: 56, height: 56 }}
                        />
                        <Box>
                            <Typography variant="h6" sx={{ fontSize: '1rem' }}>
                                {user.name}
                            </Typography>
                            <Typography color="text.secondary" variant="body2">
                                {user.jobRole}
                            </Typography>
                        </Box>
                    </Box>

                    <Stack spacing={1}>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                            <BusinessIcon fontSize="small" color="action" />
                            <Typography variant="body2" color="text.secondary">
                                {user.team}
                            </Typography>
                        </Box>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                            <LocationIcon fontSize="small" color="action" />
                            <Typography variant="body2" color="text.secondary">
                                {user.location}
                            </Typography>
                        </Box>
                        <Tooltip title="Send email">
                            <Link 
                                href={`mailto:${user.email}`}
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <EmailIcon fontSize="small" color="action" />
                                <Typography variant="body2" noWrap>
                                    {user.email}
                                </Typography>
                            </Link>
                        </Tooltip>
                        <Tooltip title="Call">
                            <Link 
                                href={`tel:${user.phone}`}
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <PhoneIcon fontSize="small" color="action" />
                                <Typography variant="body2">
                                    {user.phone}
                                </Typography>
                            </Link>
                        </Tooltip>
                        <Tooltip title="View LinkedIn profile">
                            <Link 
                                href={`https://www.${user.linkedin}`}
                                target="_blank"
                                rel="noopener noreferrer"
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <LinkedInIcon fontSize="small" color="action" />
                                <Typography variant="body2" noWrap>
                                    {user.linkedin}
                                </Typography>
                            </Link>
                        </Tooltip>
                    </Stack>
                </Stack>
            </CardContent>
        </Card>
    );
};

const buildTreeData = (users: User[]): TreeData => {
    const buildNode = (user: User): TreeData => {
        const directReports = users.filter(u => u.managerId === user.id);
        return {
            name: user.name,
            attributes: {
                id: user.id.toString()
            },
            children: directReports.map(report => buildNode(report))
        };
    };

    const rootUser = users.find(user => !user.managerId);
    return rootUser ? buildNode(rootUser) : { name: 'No Data', attributes: { id: '0' } };
};

const renderForeignObjectNode = ({
    nodeDatum,
    foreignObjectProps
}: CustomNodeElementProps) => {
    const userId = (nodeDatum.attributes as { id?: string })?.id;
    const user = userId ? mockUsers.find(u => u.id.toString() === userId) : undefined;

    return (
        <g>
            <foreignObject {...foreignObjectProps}>
                <UserProfileCard user={user} />
            </foreignObject>
        </g>
    );
};

const OrgChart: React.FC = () => {
    const theme = useTheme();
    const treeData = buildTreeData(mockUsers);

    const nodeSize = { x: 300, y: 200 };
    const foreignObjectProps = {
        width: nodeSize.x,
        height: nodeSize.y,
        x: -150,
        y: -100,
    };

    return (
        <Box sx={{ width: '100%', pt: 2 }}>
            <Typography variant="h4" component="h1" sx={{ mb: 4 }}>
                Organization Chart
            </Typography>
            <Paper sx={{ 
                height: 'calc(100vh - 180px)',
                p: 4,
                overflow: 'hidden'
            }}>
                <Box sx={{ width: '100%', height: '100%' }}>
                    <Tree
                        data={treeData}
                        nodeSize={nodeSize}
                        renderCustomNodeElement={(rd) => 
                            renderForeignObjectNode({
                                ...rd,
                                foreignObjectProps
                            })
                        }
                        orientation="vertical"
                        pathFunc="step"
                        separation={{ siblings: 2, nonSiblings: 2.5 }}
                        translate={{ x: 500, y: 50 }}
                        zoom={0.8}
                    />
                </Box>
            </Paper>
        </Box>
    );
};

